        .vpc(vpc)
        .build();
VpcLink link = VpcLink.Builder.create(this, "link")
        .targets(List.of(nlb))
        .build();

Integration integration = Integration.Builder.create()
        .type(IntegrationType.HTTP_PROXY)
        .options(IntegrationOptions.builder()
                .connectionType(ConnectionType.VPC_LINK)
                .vpcLink(link)
                .build())
        .build();

